import React from 'react'
import notes from '../assets/data'
import ListItem from '../components/ListItem'

const NotesPage = () => {
    return (
        <div>
            {notes.map(note => (
                <ListItem note={note} />
            ))}
            <h1>Note Stuff</h1>
        </div>
    )
}

export default NotesPage
